.wt-sky-dictionary-page .container {
  position: relative;
  max-width: 990px;
  margin: 0 auto;
  padding: 0 10px;
}
.wt-sky-dictionary-page .page {
  font-weight: 300;
  padding-bottom: 48px;
}
.wt-sky-dictionary-page .page__button {
  height: 26px;
  width: 30px;
  border-radius: 4px;
  background-image: linear-gradient(to bottom, #ffffff, #f5f5f5);
  border: solid 1px #ddd;
  color: #333333;
  font-size: 14px;
  display: inline-block;
  padding: 4px 10px;
  line-height: 1;
  box-sizing: border-box;
  cursor: pointer;
  margin: 0 5px;
  position: relative;
  top: 2px;
  user-select: none;
}
.wt-sky-dictionary-page .page__button:first-child {
  margin-left: 0;
}
.wt-sky-dictionary-page .page__button:last-child {
  margin-right: 0;
}
.wt-sky-dictionary-page .page__button:active {
  box-shadow: inset 0 0 3px 0 rgba(0, 0, 0, 0.3);
}
.wt-sky-dictionary-page .page__button--primary {
  background-image: linear-gradient(to bottom, #5d9cec, #4a89dc);
  background-size: 100%;
  background-repeat: no-repeat;
  background-position: center;
  width: auto;
  color: #fff;
  font-weight: 600;

  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  font-smoothing: antialiased;
  font-family: 'Open Sans', sans-serif;
  transition: background-color 0.15s linear;
  overflow: hidden;
  min-height: 100%;
}
.wt-sky-reader__main {
  display: flex;
  justify-content: center;
  padding-left: 42px;
  padding-right: 42px;
}
.wt-sky-reader__article {
  position: relative;
  max-width: 90vw;
  width: 60vw;
  padding: 45px 60px;
  box-sizing: border-box;
}
.wt-sky-reader__side {
  flex: 0 0 340px;
  position: relative;
  width: 340px;
  padding: 60px 20px;
  box-sizing: border-box;
}
.wt-sky-reader__tools {
  position: fixed;
  width: 300px;
  overflow-y: auto;
  height: 85%;
}
.wt-sky-reader__tools .vimbox-words__item-text-line {
  opacity: 0.3;
}
.wt-sky-reader__tools::-webkit-scrollbar {
  width: 6px;
}
.wt-sky-reader__tools::-webkit-scrollbar-track {
  border-radius: 6px;
}
.wt-sky-reader__tools::-webkit-scrollbar-thumb {
  border-radius: 6px;
}
</style><style>.wt-sky-reader--light {

}

}
.wt-sky-reader--dark {

}
